import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';
import Layout from './components/LayoutComponent';

export default function App() {

  return (
    <Routes>
      <Route path="/" element={<Layout />}></Route>
    </Routes>
  );
}

 App;
